import React, { Component } from 'react';
import { Table, Divider, Button, Input } from 'antd'
import { Link } from 'react-router-dom'
export default class shop extends Component {
    // constructor(props) {
    //     super(props)
    // }
    dataSource = [{
        key: '1',
        name: '胡彦斌',
        age: 32,
        address: '西湖区湖底公园1号'
    }, {
        key: '2',
        name: '胡彦祖',
        age: 42,
        address: '西湖区湖底公园1号'
    }];
    columns = [
        {
            align: 'center',
            title: '姓名',
            dataIndex: 'name',
            key: 'name',
        }, {
            align: 'center',
            title: '年龄',
            dataIndex: 'age',
            key: 'age',
        }, {
            align: 'center',
            title: '住址',
            dataIndex: 'address',
            key: 'address',
        }, {
            align: 'center',
            title: '操作',
            key: 'action',
            render: (text, record) => (
                <span>
                    <Link to=''>
                        绑定供应商
                    </Link>
                </span>
            ),
        }
    ];
    rowSelection = {
        onChange: (index, row) => { }
    }
    render() {
        return (
            <div>
                <div>
                    <div>
                        <Button>商品同步</Button>
                        <Button>类别同步</Button>
                        <Button>供应商同步</Button>
                    </div>
                    <div>
                        <Input prefix={<Icon type="user" style={{ color: 'rgba(0,0,0,.25)' }} />} placeholder="搜索" />
                        <Button>搜索</Button>
                        <Button>导出</Button>
                    </div>
                </div>
                <Table
                    loading={false}
                    pagination={false} //-- 不使用自带的分页器
                    rowSelection={this.rowSelection}
                    dataSource={this.dataSource}
                    columns={this.columns}
                />
            </div >
        )
    }
}
